const getAsset = asset => {
    if (asset === "configure") {
        return "";
    } else if (asset === "custom") {
        return "";
    } else if (asset === "default") {
        return "";
    }
    return "";
};

module.exports = {
    image: asset => {
        const mime = asset === "default" ? "image/png+xml" : "image/svg+xml";
        return `data:${mime};base64,${getAsset(asset)}`;
    }
};


